import React from 'react'
import { ReactPropTypes } from 'react'

function Header (props) {
    return(
        <header className='bg-secondary text-white '>
                <h2>{props.text}</h2>
        
        </header>
    )

}
Header.defaultProps={
   text:"Feedback UI",
   bgColor:'gray'
}
// Header.prototype={
//     text:ReactPropTypes.string,
// }


export default Header;
